import Layout from '../components/layout'
import firebase from '../firebaseConfig'
import Login from './user/login'

export default function() {

  const cerrar = async () => {
    firebase.auth().signOut()
  }

  return(
      <Layout title="Index">
          <h1>Index</h1>

          <button>Cerrar session</button>
      </Layout>
  )
}
